  return (
    <footer className="my-5 pt-5 text-body-secondary text-center text-small">
    <p className="mb-1">&copy; Lisa and Jaya</p>
  </footer>
  );
};

const Footer = () => {
  return (
    <footer className="my-5 pt-5 text-body-secondary text-center text-small">
      <p className="mb-1">&copy; Lisa and Jaya</p>
    </footer>
  );
};



const Content = () => {
 
  switch (props.page) {
    case 'home':
      content = (<div></div>);
    case 'Cart':
      content = (<div></div>);
    case 'Summary':
      content = (<div></div>);
    default:
      content = <div>Default Content</div>;
  }

  return <div>{content}</div>;
};
export { Header, Footer, Content };
